import React, { useContext } from 'react';
import { AppContext } from '../App';

const CompAddList = () => {

  const { _todoArr , _setTodoArr} = useContext(AppContext)

  const fnSubmitHandler = function (e) {
    e.preventDefault()
  }

  return (
    <div>
      <h2>일정추가</h2>
      <form onSubmit={fnSubmitHandler}>
        <p><input type="date" required /></p>
        <p><input type="time" required /></p>
        <p><input type="text" required /></p>
        <p><textarea required></textarea></p>
        <p><button>일정등록</button></p>
      </form>
    </div>
  );
};

export default CompAddList;
